import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";

export default function App() {
  return 
     <Router>
       <Routes>
         <Route path="/" element={<Home />} />
       </Routes>
     </Router>

}

function Home(){
  return 
   <div>
     <h1>Welcome Home</h1>
   </div>

}
